var count = 0;

function increase(){
  count++;
  console.log(count);
}

ReactDOM.render(
  <div className = "container">
    <h1>{count}</h1>
    <button onClick={increase}>+</button>
  </div>,
  document.getElementById("root")
);

export default App;
